class Solution:
    def numMatchingSubseq(self, s: str, words: List[str]) -> int:
        match = 0
        N = len(s)
        matched, not_matched = set(), set()
        
        def isMatch(w, s):
            M = len(w)
            i = j = 0
            while i < N and j < M:
                if s[i] == w[j]:
                    i += 1
                    j += 1
                else:
                    i += 1
                    
            return j == M
        
        for word in words:
            if word in matched:
                match += 1
                continue
            elif word in not_matched:
                continue
            elif isMatch(word, s):
                match += 1
                matched.add(word)
            else:
                not_matched.add(word)
        return match
        


